// SPDX-License-Identifier: GPL-3.0

pragma solidity >=0.7.0 <0.9.0;

contract Verificacio{

    //1. Elements del contracte

    // Primer identifiquem el propietari del document
    address private propietari;

    // Nom del document
    string private filename;

    // Validadors del document
    address[] private validadors;

    // Mapa de comprovació de les validacions -> Validador = TRUE/FALSE
    mapping (address=>bool) private validacions;
    //Contador de validacions (map no té la funció length incorporada)
    uint256 private nValidacions;

    //2. CONSTRUCTOR
    event OwnerSet(address indexed anticProp, address indexed nouProp);
    
    constructor(string memory _filename) {
        propietari = msg.sender;
        filename = _filename;
        nValidacions = 0;

        emit OwnerSet(address(0), propietari);
    }

    //3. VALIDAR
    event Validation(address indexed validador, string asset);

    function validarDocument(address nouValidador) public {

        validadors.push(nouValidador);
        nValidacions++;
        validacions[nouValidador] = true;

        emit Validation(nouValidador, filename);

    }

    //Getters
    function haValidat(address _validador) public view returns(bool) {
        return validacions[_validador];
    }

    function getOwner() public view returns(address){
        return propietari;
    }

    function getFilename() public view returns(string memory){
        return filename;
    }

    function getNumberOfValidations() public view returns(uint256) {
        return nValidacions;
    }

    


}

